import React from "react";

export default function Video() {
  return (
    <div className="video-page">
        <div className="left-side-container video-comments-container">
            <div className="video-container">
                <iframe width="966" height="543" src="https://www.youtube.com/embed/TBOmUuG-9BY" title="It&#39;s time to talk about these UI trends" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" allowfullscreen></iframe>
                <iframe width="966" height="543" src="https://www.youtube.com/embed/TBOmUuG-9BY" title="It&#39;s time to talk about these UI trends" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" allowfullscreen></iframe>
            </div>
        </div>
    </div>
  );
}
